import NicknameEditForm from "../componets/NicknameEditForm";
import FollowList from "../componets/FollowerList";
import Head from 'next/head';


const Home = () => {
    return (
        <>
        <Head>
            <title>Node Bird</title>
        </Head>
        <AppLayout>       
            <div>
                <h1>Hello, Next</h1>
            </div>
        </AppLayout>
        </>
    );
}

export default Home;
